                <li key={dataVal.id} className='list'>
                <span className='ID'>{dataVal.id} </span>
                <span className='Titles'>{dataVal.attributes.titles[0].title}</span>
                </li>
          ))
        }
      </ul>
    );
  };

  /* {data.data.map((dataVal:any) => {
